function searchSong() {
    const query = document.getElementById('search').value.toLowerCase();
    const song = songs.find(s => s.title.toLowerCase().includes(query));

    if (song) {
        updateSongCard(song);
        showNotification(`Playing: ${song.title}`);
    } else {
        showNotification("Song not found");
    }
}

function updateSongCard(song) {
    document.getElementById('song-title').innerText = song.title;
    document.getElementById('audio-source').src = song.src;
    document.getElementById('album-cover').src = song.cover;
    document.getElementById('audio-player').load();
}

function showNotification(message) {
    const notification = document.getElementById('notification');
    notification.innerText = message;
    setTimeout(() => {
        notification.innerText = '';
    }, 3000);
}

function playSong() {
    document.getElementById('audio-player').play();
    showNotification('Playing');
}

function pauseSong() {
    document.getElementById('audio-player').pause();
    showNotification('Paused');
}

function stopSong() {
    const audioPlayer = document.getElementById('audio-player');
    audioPlayer.pause();
    audioPlayer.currentTime = 0;
    showNotification('Stopped');
}

function previousSong() {
    currentSongIndex = (currentSongIndex - 1 + songs.length) % songs.length;
    updateSongCard(songs[currentSongIndex]);
    playSong();
}

function nextSong() {
    currentSongIndex = (currentSongIndex + 1) % songs.length;
    updateSongCard(songs[currentSongIndex]);
    playSong();
}

function playRandomSong() {
    currentSongIndex = Math.floor(Math.random() * songs.length);
    updateSongCard(songs[currentSongIndex]);
    playSong();
}

// Event listener to detect when the current song has ended
const audioPlayer = document.getElementById('audio-player');
audioPlayer.addEventListener('ended', playRandomSong);

// Initialize the first song
updateSongCard(songs[currentSongIndex]);
